void read_data_set_info( FILE *fp, int *dataNum, int *testDataNum, int *dataSize, int *outputSize){
  fscanf(fp, "%d\n", dataNum);
  fscanf(fp, "%d\n", testDataNum);
  fscanf(fp, "%d\n", dataSize);
  fscanf(fp, "%d\n", outputSize);
}
void read_learning_data_set( FILE *fp, const int dataNum, const int testDataNum,
   double learningData[6][matrixSize][matrixSize] , double teacherOutput[6][2],
    double testData[3][matrixSize][matrixSize] ){

  int i,j,k;
  int tmp;
  for( i = 0; i < dataNum; i++ ){
    for( j = 0; j < matrixSize; j++ ){
      for( k = 0; k < matrixSize; k++ ){
        fscanf(fp, "%d,\n", &tmp);
        learningData[i][j][k] = (double)tmp;
        // printf("%d,", (int)learningData[i][j][k]);
        printf("%d,", tmp);
      }
      printf("\n");
    }
    printf("\n\n");
  }
  for( i = 0; i < dataNum; i++ ){
    for( j = 0; j < 2; j++ ){
      fscanf(fp, "%d,\n", &tmp);
      teacherOutput[i][j] = (double)tmp;
      printf("%d,", tmp);
    }
    printf("\n");
  }
  for( k = 0; k < testDataNum; k++ ){
    for( i = 0; i < matrixSize; i++ ){
      for( j = 0; j < matrixSize; j++ ){
        fscanf(fp, "%d,\n", &tmp);
        testData[k][i][j] = (double)tmp;
        printf("%d,", tmp);
      }
      printf("\n");
    }
    printf("\n\n");
  }
}
//ハッシュ関数
double hash( double z ){
        if( z >= 0){
            return 1.0;
        }else{
            return 0.0;
        }
}
//z初期化
void init_zy( double z[N], double y[OutPutNum] ){
    int i;
    for( i = 0; i < N; i++ ){
        z[i] = 0;
    }
    for( i = 0; i < OutPutNum; i++ ){
        y[i] = 0;
    }
}
//乱数生成
double getRandom(double min,double max)
{
    double randval = 100;
    while ( randval >= 1.0 || randval <= -1.0 ){
        randval = min + (double)(rand()*(max-min+1.0)/(1.0+RAND_MAX));
    }
	return randval;
}
void calc_Z( double z[N], double v[N][N+1], double testData[matrixSize][matrixSize], double y[OutPutNum] ){
  int k,i,j;
  //z,yの初期化
  init_zy( z, y );

  // Zkの計算
  for( k = 0; k < N; k++ ){
      for( i = 0; i < matrixSize; i++ ){
        for( j = 0; j < matrixSize; j++ ){

          //zの計算
          if ( i == matrixSize - 1 ){
              z[k] += v[k][i] * 1;
          }else {
              z[k] += v[k][i] * testData[i][j];
          }
        }
      }
      //printf("!");
      //ハッシュ関数
      z[k] = hash(z[k]);
      //printf("z[%d][%d] = %f\n", p, k , z[k]);
  }
}
void calc_Y( double w[1][N+1], double z[N], double y[OutPutNum]){
  int j,k;
  //yの計算
  for( j = 0; j < OutPutNum; j++){
      for( k = 0; k < N+1; k++ ){
          if ( k == N ){
              y[j] += w[j][k] * 1;
          }else {
              y[j] += w[j][k] * z[k];
          }
      }
  }
  //ハッシュ関数
  // printf("x1 = %f, x2 = %f\n", x[p][0], x[p][1]);
  // printf("before y = %f\n", y);
  for ( j = 0; j < OutPutNum; j++) {
    y[j] = hash(y[j]);
  }
  // *y = hash(*y);
  // printf("y = %f\n", y);
  // printf("---------------------------\n");

}
//２乗和を再計算
double evaluate(double testData[3][matrixSize][matrixSize], double v[N][N+1], double w[1][N+1], double t[6][2], int testDataNum ,int outputSize){
    int p,i,j,k;
    double y[outputSize];
    double z[N];
    double result_error = 0;

    for( p = 0; p < testDataNum; p++ ){
        //zの計算
        calc_Z( z, v, testData[p], y );
        //yの計算
        calc_Y( w, z, y);

        //結果の出力
        printf("%d (%d, %d)\n", p, (int)y[0], (int)y[1]);
    }

    return result_error;
}
void print_w(double w[OutPutNum][N+1]){
  //結果の表示
  int j,k;
  for( j = 0; j < 1; j++ ){
      for( k = 0; k < N+1; k++ ){
          printf("w[%d][%d] = %f  ", j, k, w[j][k]);
      }
      printf("\n");
  }
}

